import React from 'react';
import { Fab, Grid } from '@material-ui/core';

function MainControls() {
    return (
        <div style={{margin: "20px"}}>
            <Grid container>
                <Grid item style={{margin: "10px"}}>
                    <Fab color="primary" size="small"> -1 </Fab>
                </Grid>
                <Grid item xs>
                    <Fab color="primary">Play</Fab>
                </Grid>
                <Grid item style={{margin: "10px"}}>
                    <Fab color="primary" size="small"> +1 </Fab>
                </Grid>
            </Grid>

            <Fab variant="extended" color="primary">Randomize</Fab>
        </div>

    );
}

export default MainControls;
